留め具が小さかったりネイルをしていて留めにくかったネックレスが、ワンタッチで簡単に着脱できるマグネットタイプに早変わり！マグネット部は直径約8mmの球形でつまみやすく、目立ちにくい。左右のマグネット部を近づけると磁力でピタッとくっついて留められます。全長約10cmの延長チェーン付きで、長さ調節も可能。ゴールドとシルバーの2色組で幅広いアクセサリーに対応できます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">留め具が小さかったりネイルをしていて留めにくかったネックレスが、ワンタッチで簡単に着脱できるマグネットタイプに早変わり！マグネット部は直径約8mmの球形でつまみやすく、目立ちにくい。左右のマグネット部を近づけると磁力でピタッとくっついて留められます。全長約10cmの延長チェーン付きで、長さ調節も可能。ゴールドとシルバーの2色組で幅広いアクセサリーに対応できます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">留め具：全長約3cm（1個）<br> 延長チェーン：全長約10cm（1個）</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約5g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">ゴールド・シルバー</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">真鍮（ロジウムメッキ・ゴールドメッキ）</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">留め具・延長チェーン（ゴールド・シルバー） 各1セット</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
